import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import React from 'react';
import './App.css';
import Login from './components/Login/Login';

function App() {
  return (
    <>
      <Router>
      <Routes>
        <Route path="/" element={<Login />} exact />
      </Routes>
      </Router>


    </>
  );
}

export default App;
